import ItemCard from "../components/ItemCard";
import {Col, Row} from "react-bootstrap";

const Categories = () => {

    return (
        <Row>
            <Col>
                <ItemCard title={"Hamburger"} description={"Category for Hamburgers"} image={"https://www.minervafoods.com/wp-content/uploads/2016/06/como_fazer_hamburguer_caseiro.jpg"}/>
            </Col>
            <Col>
                <ItemCard title={"Hamburger"} description={"Category for Hamburgers"} image={"https://www.minervafoods.com/wp-content/uploads/2016/06/como_fazer_hamburguer_caseiro.jpg"}/>
            </Col>
            <Col>
                <ItemCard title={"Vegetables"} description={"Category for Vegetables"} image={"https://cdn.britannica.com/17/196817-050-6A15DAC3/vegetables.jpg"}/>
            </Col>
        </Row>

    );

};

export default Categories;
